import React from "react";

function Upload() {
  return (
    <div className="uploadform">
      <form>
        <h1 className="">Upload Your Image</h1>
        <br></br>
        <br></br>
        <h4>
          Name: &nbsp;&nbsp;
          <input type="text"></input>
        </h4>
        <br></br>
        <br></br>
        <h2>
          <input type="file" name="file"></input>
        </h2>
        <br></br>
        <br></br>
      </form>
    </div>
  );
}

export default Upload;
